(ns adventofcode.2018.day05
  (:require [clojure.string :as str]))


(def input "")

(defn react? [x1 x2]
  (when x1
    (and (not= x1 x2)
      (= (str/lower-case x1)
         (str/lower-case x2)))))

(defn f1 [input]
  (->> input
    (reduce
      (fn [[x1 & tail :as res] x2]
        (if (react? x1 x2)
          tail
          (conj res x2)))
      '())
    (count)))

(assert (= 11310 (f1 input)))
